Login post with Bcrypt always return false<h1>Bcrypt.compare returns false no matter what</h1>
<p>I'm currently working on a login/register feature in NextJS that utilizes bcrypt to hash and compare user passwords. I'm able to register a user with a hashed password, but when attempting to log in with <code>bcrypt.compare()</code>, the comparison always returns false, even when the entered password matches the hashed password.</p>
<p>The issue lies in this line: <code>const isPasswordMatched = await bcrypt.compare(password, user.password);</code>, where the <code>compare()</code> method is used to compare the entered password with the hashed password. Despite the method's implementation, it's not working as expected.</p>
<p><a href="https://i.stack.imgur.com/4NQSr.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/4NQSr.png" alt="Hashed password added on mongodb" /></a></p>
<h3><code>api/auth/[...nextauth].ts </code> for login</h3>
<pre class="lang-js prettyprint-override"><code>const authOptions: NextAuthOptions = {
  session: {
    strategy: &quot;jwt&quot;,
  },

  providers: [
    CredentialsProvider({
      async authorize(credentials, req) {
        await connectDB();
        const { email, password }: Icredential = credentials;

        // Find user by email
        const user = await User.findOne({ email: email });
        if (user === null) {
          throw new Error('Cannot find user');
        }

        // Check if password from input matches with the one from db
        // This is the line of the concern
        const isPasswordMatched = await bcrypt.compare(password, user.password);
        console.log(`Comparing ${password} to ${user.password}`);
        console.log(&quot;match ?&quot;, isPasswordMatched);
        // Throw error when it doesn't
        if (!isPasswordMatched)
        // if (password !== '123')
        {
          throw new Error('Invalid email or password');
        }

        // Return authorized user
        return user;
      },
      credentials: undefined
    }),
  ],
};

export default NextAuth(authOptions);
</code></pre>
<h3>api/register for register</h3>
<pre class="lang-js prettyprint-override"><code>const registerHandler = async (req: NextApiRequest, res: NextApiResponse) =&gt; {
  if (req.method === &quot;POST&quot;) {
    try {
      const { user: _regiUser } = req.body;
      console.log(_regiUser)
      //Check if user exists
      await connectDB()
      const existingUser = await User.findOne({ email: _regiUser.email }).exec();
      console.log(&quot;existingUser&quot;, existingUser);

      //Throw error when email is already in use
      if (existingUser) {
        throw new Error(&quot;Email already used&quot;);
      }
      //Password encrypted
      const hashedPassword: string = await bcrypt.hashSync( _regiUser.password, 10 );
      console.log(&quot;_regiUser.password&quot;, _regiUser.password, hashedPassword)
      console.log(hashedPassword)

      //Replace text password with encrypted password
      _regiUser.password = hashedPassword;
      console.log(_regiUser)

      //Add user on database
      await User.create(_regiUser)
      res.end()
    } catch (e: any) {
        console.log(e.message)
    }
  }
};

export default registerHandler;
