Redux updating state with null before actual data<p>I am dispatching an action that is supposed to take an input from the user and store it in a database. However, when I inspect my posts state in redux after the action is dispatched, there is a null value appended to the state array before the actual post. This is preventing me from working with the actual data in the posts array. Basically I'm wondering how to prevent null from being appended each time I dispatch a new post. Here are the relevant code <a href="https://i.stack.imgur.com/mkDw2.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/mkDw2.png" alt="enter image description here" /></a>snippets and images.</p>
<p>Post Reducer:</p>
<pre><code>import { enableAllPlugins, produce } from 'immer';

enableAllPlugins();

const initialState = {
  posts: [],
  loading: false,
  error: false,
  uploading: false,
};

const postReducer = produce((draftstate, action = {}) =&gt; {
  switch (action.type) {
    case 'UPLOAD_START':
      draftstate.loading = true;
      draftstate.error = false;
    case 'UPLOAD_SUCCESS':
      draftstate.posts.push(action.data);
      draftstate.uploading = false;
      draftstate.error = false;
    case 'UPLOAD_FAIL':
      draftstate.uploading = false;
      draftstate.error = true;
    default:
      return draftstate;
  }
}, initialState);

export default postReducer;

</code></pre>
<p>Upload Post action:</p>
<pre><code>export const uploadPost = (data) =&gt; async (dispatch) =&gt; {
  dispatch({ type: 'UPLOAD_START' });
  try {
    const newPost = await UploadApi.uploadPost(data);
    console.log('new post before', newPost);
    dispatch({ type: 'UPLOAD_SUCCESS', data: newPost.data });
  } catch (error) {
    console.log(error);
    dispatch({ type: 'UPLOAD_FAIL' });
  }
};
</code></pre>
<p>Share Post code:</p>
<pre><code>import React, { useState, useRef } from &quot;react&quot;;
import ProfileImage from &quot;../../img/profileImg.jpg&quot;;
