MongoDB - How to return matching documents and number of matching documents in array of object<p>I'm struggling to write a mongo aggregation which will return both the matching documents, as well as the number of matching documents for each identifier (in this example, staffId).</p>
<p>I have the following aggregation which works to return the count, but I can't seem to get the matching documents for each staffId.</p>
<pre><code>xxx.aggregate([
       // step 1
      {
        $match: obj,
      },
      // step 2
      {
        $group: {
          _id: &quot;$staffId&quot;,
          count: { $sum: 1 },
        },
      },
    ]);
</code></pre>
<p>The idea being that this will return an array of objects with the staffId and count. I then want to use each staffId to return the matching documents, to return something like:</p>
<pre><code>[{_id: '1234', count: 4, documents: [matching-documents for staff 1234]}, {_id: '5678', count: 12, documents: [matching-documents for staff 5768] } ]
</code></pre>
<p>Any help is massively appreciated. Thanks!</p>

