Incorrect new password with express and mongoose<p>I want to implement a controller that update the user's password.</p>
<p><strong>Problem:</strong> When a user is created, I see in database that it is hashed correctly.
When I try my controller (to update the password), I send the old password and the new one.<br />
The first time it works fine. But then, if I put the new one in old, and set a new one I get error : &quot;message&quot;: &quot;Incorrect old password&quot;. Why ?</p>
<p>My controller :</p>
<pre><code>module.exports.updatePassword = async (req, res) =&gt; {
  const { userId } = req.params;
  const { oldPassword, newPassword } = req.body;

  try {
    const user = await User.findById(userId);

    const isPasswordValid = await user.isValidPassword(oldPassword);

    if (!isPasswordValid) {
      return res.status(401).json({ message: &quot;Incorrect old password&quot; });
    }

    const salt = await bcrypt.genSalt(10);
    const newHashedPassword = await bcrypt.hash(newPassword, salt);
    const oldHashedPassword = user.password;

    if (oldHashedPassword === newHashedPassword) {
      return res
        .status(400)
        .json({
          message: &quot;New password should not be the same as old password&quot;,
        });
    }

    user.password = newHashedPassword;
    await user.save();

    return res.json({ message: &quot;Password updated successfully&quot; });
  } catch (error) {
    console.error(error);
    return res.status(500).json({ message: &quot;Server error&quot; });
  }
};
</code></pre>
<p>My User Schema :</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const bcrypt = require(&quot;bcrypt&quot;);

const UserSchema = new mongoose.Schema({
  email: {
    type: String,
    required: [true, &quot;Provide an email.&quot;],
    unique: true,
    match: [
      /^([\w-\.]+@([\w-]+\.)+[\w-]{2,4})?$/,
      &quot;Please, provide a valid email.&quot;,
    ],
  },
  password: {
    type: String,
    required: [true, &quot;Password is required.&quot;],
  },
  firstname: {
    type: String,
    required: [true, &quot;Firstname is required.&quot;],
  },
  lastname: {
    type: String,
    required: [true, &quot;Lastname is required.&quot;],
  },
});

UserSchema.pre(&quot;save&quot;, async function (next) {
  const user = this;
  const salt = await bcrypt.genSalt(10);
  const hash = await bcrypt.hash(user.password, salt);
  user.password = hash;
  next();
});

UserSchema.methods.isValidPassword = async function (password) {
  const user = this;
  const compare = await bcrypt.compare(password, user.password);

  return compare;
};

module.exports = mongoose.model(&quot;User&quot;, UserSchema);
</code></pre>

